function Table({data}) {

    return (
        <>
            <table>
                <thead>
                    <tr>
                        <th>First Name</th>
                        <th>Last Name</th>
                    </tr>
                </thead>
                <tbody>
                    { data.map(
                        value => {
                            return <tr key={value.index}>{objectIntoTableData(value)}</tr>;
                        })
                    }
                </tbody>
            </table>
        </>
    )
}
export default Table;
